import React from "react";

function Timer() {
  return (
    <div style={{ textAlign: "right", marginRight: "4vw", marginTop: "5vh" }}>
      <p style={{ color: "#9F9F9F" }}> Timer</p>
      <p>
        <button
          style={{
            color: "#9F9F9F",
            marginTop: "3vh",
            border: "none",
            width: "5vw",
          }}
        >
         
          OFF
        </button>
      </p>
      <p>
        <button
          style={{
            color: "#9F9F9F",
            marginTop: "3vh",
            border: "none",
            width: "5vw",
          }}
        >
        
          5 sec
        </button>
      </p>
      <p>
        <button
          style={{
            color: "#9F9F9F",
            marginTop: "3vh",
            border: "none",
            width: "5vw",
            borderRadius:"10px",
            boxShadow: "0px 0px 15px 0px #00000026"

          }}
        >
          {" "}
          10 sec
        </button>
      </p>
    </div>
  );
}

export default Timer;
